import React from 'react'

export default function ModalCharacter({info}){
    return (
        <div className='ModalCharacter'>
            {info ? 
            <div>
                <h3>{info.name}</h3>
                <h4>Height: {info.height}</h4>
                <h4>Mass: {info.mass}</h4>
            </div>:<h1>Cargando</h1>}
        </div>
    )
}
